<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1, viewport-fit=cover" />
  <title>The Mists Await â€” A New World Awaits</title>
  <meta name="theme-color" content="#0b1118" />
  <style>
    :root { --fg:#e9f1ff; --muted:#a7b6cf; --gold:#caa66a; --veil:rgba(0,0,0,.45); }
    html,body { height:100%; margin:0; }
    body { background:#0b1118; color:var(--fg); font-family: ui-serif, Georgia, Cambria, 'Times New Roman', serif; }
    /* Fullscreen, full-ship */
    .bg { position:fixed; inset:0; display:flex; align-items:center; justify-content:center; }
    .bg img { width:100vw; height:100vh; object-fit:contain; object-position:center; filter:brightness(.92) contrast(1.04); }
    .veil { position:fixed; inset:0; background: radial-gradient(1400px 700px at 50% -10%, rgba(255,255,255,.08), var(--veil) 60%); pointer-events:none; }
    .hud { position:fixed; inset:0; display:grid; place-items:center; text-align:center; padding: max(env(safe-area-inset-top),12px) 14px max(env(safe-area-inset-bottom),12px); }
    .wrap { width:min(960px, 92vw); background: rgba(10,15,22,.55); border:1px solid rgba(255,255,255,.08); border-radius:16px; backdrop-filter: blur(3px); padding:16px 14px 10px; box-shadow:0 30px 80px rgba(0,0,0,.6);}
    .tag { color:var(--gold); letter-spacing:.12em; text-transform:uppercase; font-size:12px; }
    h1 { margin:.15em 0 .05em; font-size: clamp(26px, 4.7vw, 40px); }
    p.sub { margin:0; color:var(--muted); font-style:italic; font-size: clamp(14px, 3vw, 18px); }
    .panel { display:flex; flex-wrap:wrap; gap:10px; justify-content:center; padding:14px 10px 8px; }
    .tile { min-width:92px; text-align:center; background: rgba(5,8,12,.65); border:1px solid rgba(255,255,255,.08); padding:12px 14px; border-radius:12px; }
    .num { font-variant-numeric: tabular-nums; font-size: clamp(30px, 7vw, 46px); line-height:1.05; }
    .lab { color:var(--muted); font-size:12px; letter-spacing:.4px; text-transform:uppercase; margin-top:2px; }
    .tagline { color:var(--gold); font-size: clamp(14px, 3vw, 18px); letter-spacing:.08em; text-transform:uppercase; margin: 4px 0 6px; }
    @media (max-width: 420px) { .wrap { background: rgba(10,15,22,.48); } }
  </style>
</head>

      <h1>The Mists Await</h1>
      <p class="sub">Departure at <span id="deadlineStr">Nov&nbsp;1, 2025 5:30&nbsp;PM</span> (Pacific)</p>
      <section class="panel" aria-live="polite" aria-atomic="true">
        <div class="tile"><div id="d" class="num">0</div><div class="lab">Days</div></div>
        <div class="tile"><div id="h" class="num">0</div><div class="lab">Hours</div></div>
        <div class="tile"><div id="m" class="num">0</div><div class="lab">Minutes</div></div>
        <div class="tile"><div id="s" class="num">0</div><div class="lab">Seconds</div></div>
      </section>
      <div class="tagline">A New World Awaits</div>
    </div>
  </div>

<script>
  // UTC anchor to avoid TZ quirks: Nov 1, 2025 17:30 Pacific == Nov 2, 2025 00:30:00 UTC
  const TARGET_EPOCH = Date.UTC(2025, 10, 2, 0, 30, 0);
  document.getElementById('deadlineStr').textContent =
    new Intl.DateTimeFormat([], { timeZone:'America/Los_Angeles', month:'short', day:'numeric', year:'numeric', hour:'numeric', minute:'2-digit' })
      .format(new Date(TARGET_EPOCH));
  const el = { d:document.getElementById('d'), h:document.getElementById('h'), m:document.getElementById('m'), s:document.getElementById('s') };
  function tick(){ const now=Date.now(); let diff=Math.max(0, TARGET_EPOCH-now);
    const t=Math.floor(diff/1000), d=Math.floor(t/86400), h=Math.floor((t%86400)/3600), m=Math.floor((t%3600)/60), s=t%60;
    el.d.textContent=String(d); el.h.textContent=String(h).padStart(2,'0'); el.m.textContent=String(m).padStart(2,'0'); el.s.textContent=String(s).padStart(2,'0'); }
  tick(); setInterval(tick,1000);
</script>
</body>
</html>
